window.bookSummaryJSON = "<p>The year 2044. The world of games changed long ago.</p> <p><i>Ascension</i> has become one of the most popular VRMMO games. It is a huge world divided into a hundred floors, with each floor a boundless location with its own countries, tribes, and millions of players.</p> <p>The object of the game is to unlock all the gates and conquer the top.</p> <p>Having joined the game, Will Thomson doesn't realize that he is all by himself. Then he accepts the first quest....</p> <p>Cursed Rat: level 46...</p>"; 
